- input: "TEXT\x1CC00390831\x1CF3XA-20110103\x1C\x1CF3XA\x1CSmall PAC work done at
    home.  With regard to the $3000 receipt from KOCH PAC on January 26, 2010; KOCH
    PAC dispursed this $3,000 contribution in December 2009 and intended it as a 2009
    calendar year contribution rather than a 2010 contribution and reported it as
    a 2009 calendar year contribution on their end.  John S Fund erroneously reported
    it as a 2010 contribution since it was not received by our treasurer until January
    26, 2010 due to mail delays.  This amendment seeks to rectify this issue by informing
    the commission of the fact that this contribution should have been reported as
    a 2009 contribution by the John S. Fund despite being received in 2010.  This
    amendment is a response to FEC notice dated December 1, 2010.\n"
